(41, 'Timelords', '&quot;We are sworn never to interfere, only to watch.&quot;\r\n\r\n---\r\n\r\n[IMG]http://www.pic-upload.eu/p/fa3b55d44f63e34a3ab266be750d5d5c[/IMG]\r\n\r\n---', 293, ''),
(37, 'EIN MANN ARMEE', 'NUR pnuT7z sonst keiner :D', 302, ''),
(38, 'Brotherhood of Weapen', 'Hier gibt es 3 Regeln:\r\n\r\n1. &quot;EINER für ALLE, ALLE für EINEN&quot;\r\n\r\n2. &quot;AUGE um AUGE, ZAHN um ZAHN&quot;\r\n\r\n3. KEINER WIRD IM STICH GELASSEN!\r\n\r\n ', 310, ''),
(39, 'ZnD', '&gt;&gt;ZnD ist das Akronym für [b]Zahnarzt NEIN Danke[/b].&lt;&lt;\r\n\r\nDie Allianz ZnD ist eine Vereinigung von Menschen, die jährliche Zahnarztbesuche ablehnen und ihre Löcher mit stolz tragen. \r\nEin ordentlich entstelltes Gebiss ist das Ideal der Zukunft.\r\nSeid auch Ihr stolz auf eure Mundfäule oder habt schiefe Zähne, dann seid Ihr hier genau richtig und werdet ein Mitstreiter bei ZnD! \r\n\r\n[IMG]http://www.pic-upload.eu/p/c1990abbad65a95aeb58c5589a130ddd[/IMG]\r\n\r\n[b]Verträge:[/b]', 325, ''),
(43, 'Daleks', 'EXTERMINATE! EXTERMINATE!\r\n\r\n[IMG]http://www.pic-upload.eu/p/586791a98cda478204b56c5925a96522[/IMG]', 336, ''),
(45, 'Galaktische Republik', '[IMG]http://www.pic-upload.eu/p/ade5af78c53b60aa8b29ca328b8b1582[/IMG]\r\n\r\n\r\n[b]&quot;Es ist unser erklärtes Ziel das Universum zu befrieden und Seperatisten zu bekämpfen, um ein einheitliches und freies Staatssystem zu begründen.&quot; [/b] \r\n\r\nDie Galaktische Republik, später auch als Alte Republik bezeichnet, wurde 25.053 VSY gegründet.\r\nNachdem verschiedene Zivilisationen in den Kernwelten die überlichtschnelle Raumfahrt entdeckt hatten, schlossen sie sich zu einer galaktischen Regierung zusammen.\r\nDie Republik wurde unterstützt von dem Jedi-Orden, der sich dieser 100 Jahre nach Gründung der Republik anschloss und für den Frieden und die Gerechtigkeit in der Galaxis sorgte.\r\n\r\nZusammenhalt, Treue und liberale Grundprinzipien sind die Kerngedanken der Galktischen Republick und begründen somit die Motivation nach Freiheit und Demokratie.', 337, ''),
(46, 'FABS', '[IMG]http://www.pic-upload.eu/p/e277410e452ed56267db31decdf321bc[/IMG]', 299, '');
