(325, 'Im Impressum (siehe unten) steht folgender Mann als Inhaber:<br /><br />Matthias Herzog<br />Großenhainer Str. 17<br />01561 Schönfeld<br /><br />eMail-Adresse: Matthias-Herzog@gmx.net<br />Telefonnummer: 035248 / 81911<br /><br />---<br /><br />Ich habe ihn heute angerufen bzw. die oben genannte Telefonnummer, weil ich einige Verbesserungen und Ideen vorschlagen wollte. Alles was ich bekam war ein Herr Schmidt, der laut eigener Aussage da schon seit 25 Jahren wohnt und keine Ahnung von einem Herr Herzog, von einem Onlinegame und von diesem Impressum hat. Er hat sich gleich mal die Domain zu dieser Seite notiert und will nachschauen und jemanden benachrichtigen oder einschalten. Ich frage mich warum der Inhaber eine falsche bzw. fremde Telefonnummer in seinem Impressum stehen hat !?! ...Antworten ???', 339, '2011-12-24 10:25:46', 83),
(326, 'Ich habe nun rausgefunden, dass diese Telefonnummer zu einem Elektrobetrieb gehört:\r\n\r\nSchmidt Jürgen Elektroinstallation\r\nWeinbergsweg 29\r\n01561 Schönfeld b Großenhain, Sachs\r\nTelefon: 035248 / 81911\r\nTelefax: 035248 /\r\n\r\n---\r\n\r\nKomischerweise hat Herr Herzog Herrn Schmidts Telefonnummer in JEDEM seiner Impressen drin stehen (Absicht ???):\r\n\r\n- http://www.final-end.de/index.php?Section=ImpressumExtern\r\n\r\n- http://www.final-end.de/forum/index.php?section=Impressum\r\n\r\n- http://final-end.de/wiki/index.php/Final-End.de_WIKI:Impressum\r\n\r\n- http://www.sce-lan.de/tools/Math/index.php?Section=Impressum\r\n\r\n- http://www.sce-lan.de/index.php?section=Impressum\r\n\r\n---\r\n\r\nWas soll das nun alles bedeuten? ...ich weiß mittlerweile wer der Herr in Facebook ist und wie er aussieht:\r\n\r\nhttp://www.facebook.com/profile.php?id=100000696749099\r\n\r\nHabe ich über die Facebook-Likebox auf der Login-Seite von diesem Game rausgefunden bzw. kam so auf die Idee mal in Facebook zu schauen, denn er hat sich nämich quasi selber geliked !!! *lol* ;-)', 339, '2011-12-25 00:43:47', 83),
