(336, 'Hier sind von allen Mitgliedern nach Eintrittsreihenfolge die Spendenlinks. Wäre toll, wenn ihr einmal am Tag alle durchklicken würdet so das wqir an Kohle kommen. Wer genug Credits besitzt und keine mehr braucht kann das hier rein schreiben. Neue Mitglieder schicken bitte ihre Spendenlinks per PM an den Administrator der Allianz und der fügt ihn dann hier hinzu. Hier also nun die Links aller Mitglieder:<br /><br />1. <b><a target="_blanke" href="http://www.final-end.de/index.php?Ref=339">SPENDENLINK VON XCHANGER</a></b><br />2. <b><a target="_blanke" href="http://www.final-end.de/index.php?Ref=310">SPENDENLINK VON GRIZZLY</a></b><br />3. <b><a target="_blanke" href="http://www.final-end.de/index.php?Ref=346">SPENDENLINK VON DUMDIDELDEI</a></b>', 339, '2012-01-06 15:33:42', 91),
