(341, 'ach wie toll hier ist...soviel platz zum schreiben...xD...ich weis der war flach :P', 337, '2012-01-22 19:00:28', 96),
(342, 'Hallo an alle.<br /><br />Ich wollte nur mitteilen, dass ich nicht weiss wie lange ich das hier noch spielen kann, da mich dieser Cooper, der erst bei uns mitmachen wollte, aber sich dann über eine fehlende storybezogene Allianzeinleitung aufgeregt hat, dauert angreift, meine Flotten zerstört hat und meine Planeten erobert. Da dies eine Betatest-Phase ist und es hier nicht mal planetare Verteidigungsanlagen gibt werde ich nur noch meinen Hauptplaneten bebauen und wenn dann alles weg ist, dann werde ich nicht weiter machen. Es sei denn ihr unternehmt was gegen diesen COOPER !!!<br /><br />...steht euch natürlich frei.<br /><br />Gruß<br />Xchanger aka Daniel<br />MCSE @ Hyper-WAN', 339, '2012-01-31 19:54:47', 97),
(343, '', 310, '2012-02-01 18:30:54', 83),
(344, '', 310, '2012-02-01 18:31:56', 97);
