('Grizzly', 'Xchanger', 'der text ist schon ok aber für meinen geschmack etwas zu lang! in meinem alten bündnis stand nur das: \r\n\r\n1. &quot;EINER für ALLE, ALLE für EINEN&quot;\r\n\r\n2. &quot;AUGE um AUGE, ZAHN um ZAHN&quot;\r\n\r\n3. KEINER WIRD IM STICH GELASSEN!\r\n\r\nich finde die drei zeilen sagen genauso viel aus, wie dein gesammter text. ich meine, bei deinem text klingt das alles bischen &quot;gehobener&quot;. aber es ist jetzt nicht so, das mich dein text stört, ich find ihn halt nur etwas zu lang! \r\n', 182971, '2011-12-26 10:03:24', 0, 'Re:Re:AW', 0, 0, 1, 0),
