('Xchanger', 'Cooper', '1. ist das keine Firma, sondern nur ein Freizeitprojekt von einer Hand voll Studenten bei denen es um Onlinegaming und Internetcommunitys geht und da wir sowas derzeit auch selber programmieren war es halt eine witzige Idee.\r\n\r\n2. steht schon drin, dass wir offen für alles sind und wenn dir was besseres einfällt, dann her damit ...aber Kritik zu üben und dann selber keine Vorschläge zu haben ist auch arm, oder irre ich da etwa ???\r\n\r\nund 3. zwinge ich niemanden. Ich habe es nun schon umgetippt, kurz gehalten und nur das nötigste reingeballert und dafür mehr ins Allianzforum geschrieben, aber das reicht scheinbar nicht aus. Dann identifizier dich besseren Ideen und wenn du welche haben solltest kannst du dich ja im neuen Jahr gerne noch mal melden.\r\n\r\nAnsonsten wünsche ich dir weiterhin viel Spaß in deiner Ein-Mann-Allianz !!!\r\n\r\nCiao', 182990, '2011-12-26 13:59:48', 0, 'Re:Re:Re:Re:Re:Re:Re:Universale Allianz !!!', 0, 0, 1, 0),
